import React from "react";

const { Kakao } = window;

function Second() {
  const kakaoLoginClickHandler = () => {
    Kakao.Auth.login({
      success: function (res) {
        console.log(res);
      },
      fail: function (err) {
        console.log(err);
      },
    });
  };

  return (
    <article className="socialLogin">
      <button fill className="btn kakao" onClick={kakaoLoginClickHandler} />
    </article>
  );
}

export default Second;
